import React from "react";
import { Link } from "react-router-dom";

const Home = () => (
  <div style={{ textAlign: "center", padding: "50px" }}>
    <h1>Welcome to Store Rating App</h1>
    <p>Discover and rate your favorite stores!</p>
    <div style={{ marginTop: "30px" }}>
      <Link to="/login" style={{ margin: "10px", padding: "10px 20px", backgroundColor: "#007bff", color: "white", textDecoration: "none", borderRadius: "5px" }}>
        Login
      </Link>
      <Link to="/signup" style={{ margin: "10px", padding: "10px 20px", backgroundColor: "#28a745", color: "white", textDecoration: "none", borderRadius: "5px" }}>
        Sign Up
      </Link>
    </div>
  </div>
);

export default Home;
